  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean circulation and other data was collected
  from SUBSURFACE FLOATS from the North Atlantic Ocean and other locations. Data were
  collected from Scripps Institution of Oceanography (SIO) and other institutions
  as part of the World Ocean Circulation Experiment (WOCE) from 01 January 1984 to
  31 December 1990. Data are in the WHOI floater format and parameters include East-West
  current components (U), North-South current components (V), water temperature, and
  water pressure.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
